        <div>
        <Typography component="h1" variant="h3" style={title}>
            <b>The Hope Center</b>
         </Typography>

        <Box
        component="form"
        sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
        >
